

create database data_sharing_protocol;

use data_sharing_protocol;


SET FOREIGN_KEY_CHECKS=0;

DROP TABLE IF EXISTS `attacker`;
CREATE TABLE `attacker` (
  `user` text,
  `fname` text,
  `ownername` text,
  `sk` text,
  `type` text,
  `dt` text
) ENGINE=InnoDB DEFAULT CHARSET=latin1;


DROP TABLE IF EXISTS `cloud`;
CREATE TABLE `cloud` (
  `name` text,
  `pass` text
) ENGINE=InnoDB DEFAULT CHARSET=latin1;

DROP TABLE IF EXISTS `cloudserver`;
CREATE TABLE `cloudserver` (
  `id` int(11) NOT NULL auto_increment,
  `p1` text,
  `p2` text,
  `p3` text,
  `p4` text,
  `p5` text,
  `p6` text,
  `fname` text,
  `ct` text,
  `trapdoor` text,
  `sk` text,
  `rank` int(11) default NULL,
  `dt` text,
  `Oname` text,
  `gkey` text,
  PRIMARY KEY  (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=latin1;

DROP TABLE IF EXISTS `keyattacker`;
CREATE TABLE `keyattacker` (
  `fname` text,
  `sk` text,
  `type` text,
  `dt` text,
  `Aname` text
) ENGINE=InnoDB DEFAULT CHARSET=latin1;


DROP TABLE IF EXISTS `owner`;
CREATE TABLE `owner` (
  `id` int(11) NOT NULL auto_increment,
  `name` text,
  `pass` text,
  `email` text,
  `mobile` text,
  `addr` text,
  `dob` text,
  `gender` text,
  `pin` text,
  `location` text,
  `image` longblob,
  `status` text,
  `acc_type` text,
  `group1` text,
  `gkey` text,
  PRIMARY KEY  (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=latin1;


DROP TABLE IF EXISTS `ownerfiles`;
CREATE TABLE `ownerfiles` (
  `id` int(11) NOT NULL auto_increment,
  `p1` text,
  `p2` text,
  `p3` text,
  `p4` text,
  `p5` text,
  `p6` text,
  `fname` text,
  `ct` text,
  `trapdoor` text,
  `sk` text,
  `rank` int(11) default NULL,
  `dt` text,
  `oname` text,
  `gkey` text,
  PRIMARY KEY  (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=latin1;


DROP TABLE IF EXISTS `results`;
CREATE TABLE `results` (
  `fname` text,
  `tdelay` text,
  `tpt` text
) ENGINE=InnoDB DEFAULT CHARSET=latin1;


DROP TABLE IF EXISTS `srequest`;
CREATE TABLE `srequest` (
  `id` int(11) NOT NULL auto_increment,
  `user` text,
  `status` text,
  `dt` text,
  `oname` text,
  PRIMARY KEY  (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=latin1;


DROP TABLE IF EXISTS `transaction`;
CREATE TABLE `transaction` (
  `id` int(11) NOT NULL auto_increment,
  `user` text,
  `fname` text,
  `sk` text,
  `task` text,
  `dt` text,
  PRIMARY KEY  (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=latin1;


DROP TABLE IF EXISTS `user`;
CREATE TABLE `user` (
  `id` int(11) NOT NULL auto_increment,
  `name` text,
  `pass` text,
  `email` text,
  `mobile` text,
  `addr` text,
  `dob` text,
  `gender` text,
  `pin` text,
  `location` text,
  `image` longblob,
  `status` text,
  `acc_type` text,
  `group1` text,
  `gkey` text,
  PRIMARY KEY  (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=latin1;


